import React, { Component } from "react";
import { Container, Card } from "react-bootstrap";

class Cards extends Component {
  render() {
    return (
      <div>
        <Container>
          <Card
            className="justify-content-md-center d-flex my-auto"
            style={{ width: "50%", height: "50rem", background: "red" }}
          ></Card>
        </Container>
      </div>
    );
  }
}

export default Cards;
